var title_f36_53_37726="Early gastric cancer survival nomogram";
var content_f36_53_37726=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F74583&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F74583&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 639px\">",
"   <div class=\"ttl\">",
"    Survival probability nomogram for early gastric cancer",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 619px; height: 484px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Find the position of each variable on the corresponding axis and draw a line to the \"Points\" axis to determine the number of points for each variable. Add the points for all the variables together and draw a line from the \"Total points\" axis to determine the survival probabilities at the bottom, assuming no death from other causes.",
"    <div class=\"footnotes\">",
"     DFS: disease-free survival.",
"    </div>",
"    <div class=\"reference\">",
"     From: Kim JH, Kim HS, Seo WY, et al. External validation of nomogram for the prediction of recurrence after curative resection in early gastric cancer. Ann Oncol. 2012; 23:361, by permission of the European Society for Medical Oncology. Copyright &copy; 2012 Oxford University Press.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
